      label: 'Profile',
      icon: mdiAccountCircle
    },
    {
      to: '/login',
      label: 'Login',
      icon: mdiLock
    },
    {
      to: '/error',
      label: 'Error',
      icon: mdiAlertCircle
    },
    {
      label: 'Submenus',
      subLabel: 'Submenus Example',
      icon: mdiViewList,
      menu: [
        {
          to: '/login',
          label: 'Sub-item One'
        },
        {
          to: '/login',
          label: 'Sub-item Two'
        }
      ]
    }
  ],
  'About',
  [
